import React, { useState } from 'react';
import './CreateTask.css';

const CreateTask = ({ onClose, onSubmit }) => {
  const [title, setTitle] = useState('');
  const [assignee, setAssignee] = useState('');
  const [stage, setStage] = useState('TODO');
  const [date, setDate] = useState('');
  const [priority, setPriority] = useState('NORMAL');
  const [assets, setAssets] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ title, assignee, stage, date, priority, assets });
    onClose(); // Close the modal after submission
  };

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <h2>Add Task</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="title">Task Title</label>
            <input
              id="title"
              type="text"
              placeholder="Task title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="assignee">Assign Task To</label>
            <input
              id="assignee"
              type="text"
              placeholder="Assignee Name"
              value={assignee}
              onChange={(e) => setAssignee(e.target.value)}
              required
            />
          </div>
          <div className="form-row">
            <div className="form-group">
              <label htmlFor="stage">Task Stage</label>
              <select
                id="stage"
                value={stage}
                onChange={(e) => setStage(e.target.value)}
              >
                <option value="TODO">TODO</option>
                <option value="IN_PROGRESS">In Progress</option>
                <option value="COMPLETED">Completed</option>
              </select>
            </div>
            <div className="form-group">
              <label htmlFor="date">Task Date</label>
              <input
                id="date"
                type="date"
                value={date}
                onChange={(e) => setDate(e.target.value)}
                required
              />
            </div>
          </div>
          <div className="form-row">
            <div className="form-group">
              <label htmlFor="priority">Priority Level</label>
              <select
                id="priority"
                value={priority}
                onChange={(e) => setPriority(e.target.value)}
              >
                <option value="NORMAL">Normal</option>
                <option value="HIGH">High</option>
                <option value="LOW">Low</option>
              </select>
            </div>
            <div className="form-group assets-checkbox">
              <label>
                <input
                  type="checkbox"
                  checked={assets}
                  onChange={(e) => setAssets(e.target.checked)}
                />
                Add Assets
              </label>
            </div>
          </div>
          <div className="form-actions">
            <button type="submit" className="submit-btn">Submit</button>
            <button type="button" className="cancel-btn" onClick={onClose}>
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default CreateTask;
